import './MenuNavegacion.css'

const MenuNavegacion = () => {
  return (
    <header>
        <h1>LagrimasNegras Shop</h1>
        <nav>
            <ul>
                <li>HOME</li>
                <li>ABOUT US</li>
                <li>MARKET</li>
                <li>CARRITO</li>
            </ul>
        </nav>
    </header>
  );
}

export default MenuNavegacion;
